import React, {useState} from "react";
import { Dialog, DialogActions, DialogContent, DialogTitle, DialogContentText, TextField } from "@mui/material";
import Button from "@mui/material/Button";
import AddButton from "./IDE/AddButton";


function TextPopup(props) {
    const [open, setOpen] = useState(false);

    function handleOpen() {
        setOpen(true);
    }

    function handleClose() {
        setOpen(false);
    }

    return (
        <div>

            <AddButton onClick={() => handleOpen()} />
            <Dialog open={open} onClose={handleClose}>
                <DialogTitle>{props.title}</DialogTitle>
                <DialogContent>
                <DialogContentText>
                    {props.content}
                </DialogContentText>
                <TextField
                    autoFocus
                    margin="dense"
                    id="name"
                    label={props.textLabel}
                    type="text"
                    fullWidth
                    variant="standard"
                />
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose()}>Cancel</Button>
                    <Button onClick={handleClose()}>Add REPL</Button>
                </DialogActions>
            </Dialog>
            
        </div>
    )
}

export default TextPopup;
